"use strict";(globalThis.webpackChunkregenx_docs=globalThis.webpackChunkregenx_docs||[]).push([[260],{1980:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","href":"/ca/documentacion/about/","label":"Sobre RegenAg-x","docId":"about","unlisted":false},{"type":"link","href":"/ca/documentacion/agriculture-landing","label":"Introducci\xf3 (agro)","docId":"agriculture-landing","unlisted":false},{"type":"link","href":"/ca/documentacion/governance","label":"Model de governan\xe7a","docId":"governance","unlisted":false},{"type":"link","href":"/ca/documentacion/use-cases","label":"Desenvolupament de casos d\'\xfas","docId":"use-cases","unlisted":false},{"type":"category","label":"Recursos t\xe8cnics","collapsed":true,"items":[{"type":"link","href":"/ca/documentacion/compute-to-data","label":"Compute-to-Data","docId":"compute-to-data","unlisted":false},{"type":"link","href":"/ca/documentacion/gaiax-standards","label":"Est\xe0ndards Gaia-X","docId":"gaiax-standards","unlisted":false},{"type":"link","href":"/ca/documentacion/market-policy","label":"Pol\xedtiques (policy.json)","docId":"market-policy","unlisted":false},{"type":"link","href":"/ca/documentacion/ocean-protocol-market","label":"Ocean, IPFS i mercat","docId":"ocean-protocol-market","unlisted":false},{"type":"link","href":"/ca/documentacion/ontologies","label":"Ontologies i models","docId":"ontologies","unlisted":false},{"type":"link","href":"/ca/documentacion/verifiable-credentials","label":"Credencials Verificables (VCs)","docId":"verifiable-credentials","unlisted":false}],"collapsible":true}]},"docs":{"about":{"id":"about","title":"Descobreix RegenAg-x","description":"RegenAg-X: Extreu el valor latent de les dades de la teva explotaci\xf3 agr\xe0ria","sidebar":"tutorialSidebar"},"agriculture-landing":{"id":"agriculture-landing","title":"Espais de dades per a l\'agricultura","description":"Espais de dades per a la ind\xfastria agroaliment\xe0ria","sidebar":"tutorialSidebar"},"compute-to-data":{"id":"compute-to-data","title":"Compute-to-Data (C2D)","description":"Compute-to-Data permet executar algoritmes a prop de la dada sense moure les dades fora del seu domini de control. En lloc de descarregar el dataset, l\'algoritme \u201cvisita\u201d una sala de dades segura, processa la informaci\xf3 i nom\xe9s retorna resultats (m\xe8triques, agregats, models entrenats).","sidebar":"tutorialSidebar"},"gaiax-standards":{"id":"gaiax-standards","title":"Est\xe0ndards Gaia-X i interoperabilitat","description":"Gaia-X defineix un marc de confian\xe7a i d\'interoperabilitat per federar espais de dades entre sectors i pa\xefsos. Els seus blocs de construcci\xf3 (autodescripcions, credencials verificables, cat\xe0legs federats, serveis de compliment, acords d\'\xfas de dades, etc.) permeten que organitzacions independents col\xb7laborin preservant la sobirania de la dada.","sidebar":"tutorialSidebar"},"governance":{"id":"governance","title":"Model de governan\xe7a","description":"1. Principis generals","sidebar":"tutorialSidebar"},"market-policy":{"id":"market-policy","title":"Pol\xedtiques d\'acc\xe9s al mercat (policy.json)","description":"Als mercats de dades i de serveis (Ocean), cada actiu pot definir les seves regles d\'\xfas mitjan\xe7ant pol\xedtiques declaratives (p. ex., policy.json). Aquestes pol\xedtiques determinen qui pot comprar/consumir, sota quines condicions i amb quin nivell d\'acc\xe9s.","sidebar":"tutorialSidebar"},"ocean-protocol-market":{"id":"ocean-protocol-market","title":"Ocean Protocol, mercat i IPFS","description":"Ocean Protocol habilita mercats de dades i de serveis d\'IA amb contractes intel\xb7ligents i un sistema de permisos flexible. Els actius (datasets, algoritmes) es publiquen amb metadades, pol\xedtiques i preus; les refer\xe8ncies als fitxers poden residir a IPFS o or\xedgens privats.","sidebar":"tutorialSidebar"},"ontologies":{"id":"ontologies","title":"Ontologies i Smart Data Models","description":"Les ontologies proporcionen vocabularis consensuats per descriure dades de manera uniforme i llegible per m\xe0quines. En un espai de dades, aix\xf2 facilita la integraci\xf3 entre fonts heterog\xe8nies, la consulta avan\xe7ada i la reutilitzaci\xf3 d\'algoritmes.","sidebar":"tutorialSidebar"},"use-cases":{"id":"use-cases","title":"Desenvolupament de casos d\'\xfas en espais de dades agroalimentaris","description":"Els espais de dades permeten construir solucions col\xb7laboratives on diferents actors del sector agroalimentari poden combinar conjunts de dades, algoritmes i serveis dins d\u2019un marc compartit de confian\xe7a. Aquesta secci\xf3 explica com es dissenyen i es despleguen casos d\u2019\xfas dins de l\u2019ecosistema RegenAg-X, seguint una metodologia pr\xe0ctica i orientada a resultats, alineada amb els principis europeus de sobirania del dada i arquitectures federades interoperables.","sidebar":"tutorialSidebar"},"verifiable-credentials":{"id":"verifiable-credentials","title":"Credencials Verificables i Gaia-X","description":"Les Credencials Verificables (VCs) permeten demostrar atributs o fets (per exemple, identitat legal, rols o conformitat) de manera criptogr\xe0ficament segura, verificable sense contactar amb l\'emissor i amb control per part del titular. A Gaia-X, les VCs i les Autodescripcions signades s\xf3n la base del marc de confian\xe7a per identificar participants, datasets i serveis.","sidebar":"tutorialSidebar"}}}}')}}]);